const Blogs = ({ persons, title, handleDelete }) => {
  return (
    <div className="blog-list">
      <h2>{title}</h2>
      {persons.map((person) => (
        <div className="blog-preview" key={person.id}>
          <Link to={`/persons/${person.id}`}>
            <h1>
              {person.name} with {person.age} years old
            </h1>
            <p>
              {person.gender} livin {person.city}
            </p>
          </Link>
          <button onClick={() => handleDelete(person.id)}>delete blog</button>
        </div>
      ))}
    </div>
  );
};

export default Blogs;
